import React, {
    useState
} from 'react'
import Timeline from 'react-calendar-timeline'
import containerResizeDetector from 'react-calendar-timeline/lib/resize-detector/container'

import moment from 'moment'
import {   
    TimelineHeaders,
    SidebarHeader,
    DateHeader,
    TimelineMarkers,
    CustomMarker,
    TodayMarker,
    CursorMarker
} from 'react-calendar-timeline'
import { 
    Row,
    Col,
    Tooltip,
} from 'antd'


// 
// IMPORT ZONE
//

const ReactScheduleTimeline01 = () => {
    const groups = [
        { id: 1, title: 'work-order-1', stackItems: true,},
        { id: 2, title: 'work-order-2', stackItems: true,},
        { id: 3, title: 'work-order-3', stackItems: true,},
        { id: 4, title: 'work-order-4', stackItems: true,},
    ]
    const deviceGroups = [
        { id: 1, title: 'MC-20', stackItems: true,},
        { id: 2, title: 'MC-30', stackItems: true,},
        { id: 3, title: 'JJ-27', stackItems: true,},
        { id: 4, title: 'NL-11', stackItems: true,},
    ]

    const items = [
        { 
           id: 1, group: 1, title: 'op1', start_time: moment('2020-12-15T11:00:00').toDate().getTime(), end_time: moment('2020-12-15T12:00:00').toDate().getTime(),
           canResize: false,
           detailContent: { 
               workOrder: '123',
               opOrder: 1
           },
           itemProps: {
             // these optional attributes are passed to the root <div /> of each item as <div {...itemProps} />
             'data-custom-attribute': 'Random content',
             'aria-hidden': true,
             onDoubleClick: () => { console.log('You clicked double!') },
             className: 'weekend',
             style: {
               background: '#2ab7ca',
               fontWeight: 'bold',
               border: 'none'
           }}
        },
        {   id: 2, 
            group: 1, 
            title: 'op2', 
            start_time: moment('2020-12-15T12:10:00').toDate().getTime(), 
            end_time: moment('2020-12-15T13:00:00').toDate().getTime(),
            detailContent: { 
                workOrder: '123',
                opOrder: 1
            },
            itemProps: {
                style: {
                    background: '#2ab7ca',
                    fontWeight: 'bold',
                    border: 'none'
                }
            }
        },
        // { id: 3, group: 1, title: 'op3', start_time: moment('2020-12-15T13:10:00'), end_time: moment('2020-12-15T14:00:00')  },
        // { id: 4, group: 1, title: 'op4', start_time: moment('2020-12-15T14:10:00'), end_time: moment('2020-12-15T14:38:00')  },
        // { id: 5, group: 2, title: 'op1', start_time: moment('2020-12-16T08:00:00'), end_time: moment('2020-12-16T09:00:00')  },
        // { id: 6, group: 2, title: 'op2', start_time: moment('2020-12-16T09:20:00'), end_time: moment('2020-12-16T09:55:00')  },
        // { id: 7, group: 3, title: 'op1', start_time: moment('2020-12-16T08:00:00'), end_time: moment('2020-12-16T09:00:00')  },
        // { id: 8, group: 3, title: 'op2', start_time: moment('2020-12-16T09:20:00'), end_time: moment('2020-12-16T09:55:00')  },
        // { id: 9, group: 3, title: 'op1', start_time: moment('2020-12-16T08:00:00'), end_time: moment('2020-12-16T09:00:00')  },
        // { id: 10, group: 3, title: 'op2', start_time: moment('2020-12-16T09:20:00'), end_time: moment('2020-12-16T09:55:00')  },
        // { id: 11, group: 4, title: 'op1', start_time: moment('2020-12-16T08:00:00'), end_time: moment('2020-12-16T09:00:00')  },
        // { id: 12, group: 4, title: 'op2', start_time: moment('2020-12-16T09:20:00'), end_time: moment('2020-12-16T09:55:00')  },
    ]

    const [ itemsArr, setItemsArr ] = useState(items)
    // 感覺 validator 也可以實做在這
    const handleItemMove = ( itemId, dragTime, newGroupOrder ) => {
        // 同一張工單 下 不在同一個 group 的時候 時間可以 比 op1 後面
        const group = groups[newGroupOrder]
        let reorderArr;
        if ( group.id === 1 && itemId === 2 && dragTime < itemsArr[0].end_time ) {
             reorderArr = itemsArr.map(
                item => item.id === itemId
                ? Object.assign({}, item, {
                    start_time: itemsArr[0].end_time,
                    end_time: itemsArr[0].end_time + (item.end_time - item.start_time),
                    group: group.id
                })
                : item
            )
        } else {
            reorderArr = itemsArr.map(
                item => item.id === itemId
                ? Object.assign({}, item, {
                    start_time: dragTime,
                    end_time: dragTime + (item.end_time - item.start_time),
                    group: group.id
                })
                : item
            )
        }

        setItemsArr(reorderArr)
    }

    const itemRenderer = ({
        item,
        itemContext,
        getItemProps,
        getResizeProps
      }) => {
        const { left: leftResizeProps, right: rightResizeProps } = getResizeProps()
        return (
            <Tooltip title={` workOrder: ${item.detailContent.workOrder}, op: ${item.detailContent.opOrder}`}>
          <div {...getItemProps(item.itemProps)}>
            {itemContext.useResizeHandle ? <div {...leftResizeProps} /> : ''}
            
               <div
                 className="rct-item-content"
                 style={{ maxHeight: `${itemContext.dimensions.height}`, color: 'black', fontSize: '1.8em', fontWeight: 'bold' }}
                 >
                 {itemContext.title}
               </div>
      
            {itemContext.useResizeHandle ? <div {...rightResizeProps} /> : ''}
          </div>
            </Tooltip>
        )}
    
    const groupRenderer = ({ group }) => {
        return (
          <div className="custom-group">
            <span className="title" style={{ fontSize: '1.5em'}} >{group.title}</span>
            <p className="tip">{group.tip}</p>
          </div>
        )
      }

    const handleMoveResizedValidator = (action, itemId, time, resizeEdge) => {
        // itemId : item detail infor
        /***
         *  {
         *   id: 
         *   group: 1, 
         *   title: "op2", 
         *   start_time: 
         *   end_time:
         *    }
         * */
        console.log("action:", action)
        console.log("itemId", itemId)
        console.log("time:", time)
        console.log("resizeEdge:", resizeEdge)
        console.log(" itemsArr[0].end_time: ",  itemsArr[0].end_time)
        // 同一張工單 test prevent op2 比 op1 在同一機台時候 還早 開工
        if (itemId.id === 2 && time < itemsArr[0].end_time && itemId.group === 1){
            return itemsArr[0].end_time
        }
        
        return time
    }
    return (
        <div>
            <Timeline 
               groups={deviceGroups}
               items={itemsArr}
               // 拖拉的時候不會有 defalut 的距離
               dragSnap={0}
               // 左邊 title 的長度 defalut: 150
               sidebarWidth={150}
               // column height default: 30
               lineHeight={50}
               // item 長度依照 lineHeight 比例 default: 0.65 
               itemHeightRatio={0.65}
               // 右邊 title 的長度 default : 150
               rightSidebarWidth={150}
               //
               canResize={false}
               // 客製 item
               itemRenderer = {itemRenderer}
               // 客製 group
               groupRenderer = {groupRenderer}
               // resizeDetector
               // resizeDetector= {containerResizeDetector}

               onItemMove={handleItemMove}
               defaultTimeStart={moment().add(-12, 'hour')}
               defaultTimeEnd={moment().add(12, 'hour')}
               // validator bar
               moveResizeValidator={handleMoveResizedValidator}
            >
                <TimelineHeaders >
                 {/* left sidebar */}
                 <SidebarHeader>
                   {({ getRootProps }) => {
                       console.log("getRootProps(): ", getRootProps())
                        return <Row style={{ backgroundColor: '#F1A709', width: 150, padding: 'auto'}} >  
                     <Col>
                           乂煞氣a排程乂
                           <img width="120" src="data:image/png;base64,
" />
                     </Col>
                        </Row>
                   }}
                 </SidebarHeader>
                 {/* right sidebar */}
                 <SidebarHeader variant="right" headerData={{someData: 'extra'}}>
                   {({ getRootProps, data }) => {
                     return <div 
                    //  {...getRootProps()}
                     style={{ backgroundColor: '#F1A709', width: 150, padding: 'auto'}}
                     > 人一定要靠自己 Right {data.someData}</div>
                   }}
                 </SidebarHeader>

                   {/* 第一排的地方 （點選： 將時間軸 觀察角度拉大 ex: 月 ---> 年 ） */}
                  <DateHeader unit="primaryHeader" style={{ backgroundColor:'#6F94CD', fontWeight: 'bold', border: 'none', minHeight: '8vh' }}/>
                   {/* 第二排的地方 （點選： 將時間軸 觀察角度拉大 ex: 小時 ---> 分鐘 ） */}
                  <DateHeader style={{ color:'#8AA228', fontWeight: 'bold', minHeight: '7vh'  }}/>
                
                </TimelineHeaders>

                {/* Marker */}
                {/* <TimelineMarkers>
                  <TodayMarker />
                  <CustomMarker date={new Date()} />
                  <CustomMarker date={new Date()}>
                    {({ styles, date }) => {
                      const customStyles = {
                        ...styles,
                        backgroundColor: 'pink',
                        opacity: 0.2,
                        width: '400px'
                      }
                      return <div style={customStyles}/>
                    }}
                  </CustomMarker>
                  <CursorMarker />
                </TimelineMarkers> */}
            </Timeline>            
        </div>
    )
}

export default ReactScheduleTimeline01
